Принимает значение: КСЧФ | КСЧФДИС | ДИС | СвИСРК | СвИСЗК, где: 
КСЧФ – корректировочный счет-фактура;
КСЧФДИС – корректировочный счет-фактура и документ об изменении стоимости товаров (работ, услуг, имущественных прав);
ДИС – документ об изменении стоимости отгруженных товаров (работ, услуг, имущественных прав);
СвИСРК –  документ, включающий в себя сведения об изменении стоимости товара комитента (принципала), ранее реализованного покупателю комиссионером (агентом, действующим от собственного имени);
СвИСЗК – документ, включающий в себя сведения об изменении стоимости товара, ранее приобретенного для комитента (принципала) комиссионером (агентом, действующим от собственного имени).
